import React, { useEffect, } from 'react';
import { Button, Breadcrumb, Row, Col, Space, Image, Form, Carousel, Card, Descriptions } from 'antd';
import { useSelector, useDispatch } from 'react-redux'
import ListWapper from "../common/ListWapper";
import { useNavigate, useParams } from 'react-router-dom';
import { useIntl } from 'react-intl';
import { AiFillBackward } from "react-icons/ai";
import { BsArrowRight } from "react-icons/bs";
import { resetSingleData, feachSingleData } from '../../store/OrdersRedux'



const Details = () => {
    const navigate = useNavigate()
    const dispatch = useDispatch()
    const { messages } = useIntl();
    const params = useParams()
    const token = useSelector((state) => state.auth.token)
    const singleData = useSelector((state) => state.orders.singleData)

    // let stories = singleData?.stories ? singleData.stories : []

    // console.log(stories)
    // const columns = [
    //     {
    //         title: 'Name',
    //         dataIndex: 'name',
    //         key: 'name',
    //         render: (text) => <a>{text}</a>,
    //     },
    //     {
    //         title: 'Description',
    //         dataIndex: 'description',
    //         key: 'age',
    //     },
    // ];


    useEffect(() => {
        // Load Details Data
        if (params.id) {
            dispatch(feachSingleData({ ...params, token }))
        }
        // Reset Date When Exit From Page
        return () => {
            dispatch(resetSingleData(null))
        }
    }, []);
    const onFinish = (values) => {

    };
    return (
        <ListWapper>
            <Form name='dynamic_rule' onFinish={onFinish}>
                <Card className='user-card user-card-lg' >

                    <Row>
                        <Col xs={12} lg={12}>
                            <Space>
                                <Breadcrumb separator='>'>
                                    <Breadcrumb.Item>{messages['sidebar.app.Managestories']}</Breadcrumb.Item>
                                    <Breadcrumb.Item>{messages['view.story']}</Breadcrumb.Item>
                                </Breadcrumb>
                            </Space>
                        </Col>
                        <Col xs={12} lg={12} >
                            <div className='promo-backbtn'>
                                <Button type='primary' danger onClick={() => navigate(-1)}><AiFillBackward size={17} />{messages['brand.back']}</Button>
                            </div>
                        </Col>
                    </Row>
                    <Space direction='vertical' className='promo-form'>
                        <Carousel autoplay>
                            <div>
                                <Space className='carousel' >
                                    <Image
                                        width={300}
                                        height={300}
                                        src='error'
                                        fallback='data:image/png;base64,'
                                    />
                                </Space>
                            </div>
                            <div>
                                <Space className='carousel'>
                                    <Image
                                        width={300}
                                        height={300}
                                        src='error'
                                        fallback='data:image/png;base64,'
                                    />
                                </Space>
                            </div>
                        </Carousel>
                    </Space>
                    <Row gutter={{ xs: 20, sm: 16, md: 32 }} >
                        <Col xs={24} lg={4} key='collapse-a'></Col>
                        <Col xs={24} lg={11} key='collapse-a' >
                            <div className='user-view'>
                                <h5>{messages['view.brand']}</h5>
                                <p>{messages['disco.nikes']}</p>
                            </div>
                            <div className='user-view'>
                                <h5>{messages['view.influencers']}</h5>
                                <p>{messages['view.number']}</p>
                            </div>
                        </Col>
                        <Col xs={24} lg={9} key='collapse-a'>
                            <div className='user-view'>
                                <h5>{messages['view.total']}</h5>
                                <p>{messages['influencers.number']}</p>
                            </div>
                        </Col>
                    </Row>

                    {/* <div className='commons-border'></div>
                    <Row gutter={{ xs: 16, sm: 16, md: 32 }}>
                        <Col xs={24} lg={4} key='collapse-a' ></Col>
                        <Col xs={24} lg={16} key='collapse-a' >
                            <div>{messages['common.influencersTitle']}</div>
                            <br />
                            <br />
                            <Space direction='vertical' style={{ width: '100%' }}>
                                <Table columns={columns} dataSource={stories} />
                            </Space>
                        </Col>
                        <Col xs={24} lg={4} key='collapse-a' ></Col>
                    </Row> */}


                </Card>
            </Form>
            <Descriptions title="Patient Details">
                <Descriptions.Item label="Product">Cloud Database</Descriptions.Item>
                <Descriptions.Item label="Billing">Prepaid</Descriptions.Item>
                <Descriptions.Item label="time">18:00:00</Descriptions.Item>
                <Descriptions.Item label="Amount">$80.00</Descriptions.Item>
                <Descriptions.Item label="Discount">$20.00</Descriptions.Item>
                <Descriptions.Item label="Official">$60.00</Descriptions.Item>
            </Descriptions>
        </ListWapper>
    );
};


export default Details;
